import React from 'react'
import { Container } from 'reactstrap';

function Contact() {
  return (
    <div>
			<Container>
				<div className="container-fluid contact">
					<h1>YOOOOOOOO</h1>
				</div>
			</Container>
    </div>
  )
}

export default Contact;
